    def is_sorted(arr: list) -> bool:
        for i in range(len(arr) - 1):
            if arr[i] > arr[i + 1]:
                return False
        return True

    def perform_swap(arr: list, start: int, end: int) -> None:
        for i in range(end - start):
            if arr[start + i] < arr[end - i]:
                swap(arr, start + i, end - i)

    def sort(arr: list) -> None:
        start = 0
        end = len(arr) - 1
        while start <= end:
