    n, m = [int(x) for x in stdin.strip().split()]
    coins = [int(x) for x in stdin.strip().split()]
    graph = defaultdict(list)
    for _ in range(m):
        x, y, w = [int(x) for x in stdin.strip().split()]
        graph[x].append((y, w))
        graph[y].append((x, w))

    def dfs(v, cost, visited, n):
        if n == -1:
            return cost
        visited[v] = True
        for adj_v, w in graph[v]:
            if not visited[adj_v]:
                if n == 1:
                    if cost + w < coins[adj_v]:
                        coins[adj_v] = cost + w
                        n = -1
                else:
                    new_cost = cost + w
                    if new_cost < coins[adj_v]:
                        coins[adj_v] = new_cost
                        n = -1
                    dfs(adj_v, new_cost, visited, n - 1)

    visited = [False] * n
    cost = [float('inf')] * n
    cost[0] = 0
    dfs(0, 0, visited, n - 1)
    return coins[0]


