    order_times = list()
    for i in range(5):
        # We want to order the dish in the order of arrival, so start from the
        # smallest time possible.
        for t in range(i, int(stdin), 10):
            order_times.append(t)
    # For each order, find the time when it is possible to serve the dish.
    for t in order_times:
        for i in range(5):
            # If we have ordered the dish at t, we can only serve it at t + 1,
            # t + 2, t + 3, t + 4, t + 5, t + 6, t + 7, t + 8, t + 9.
            for t_plus in range(t, t + 9, 10):
                if t_plus + i in order_times:
                    break
            else:
                return t

