def solution(stdin: str) -> str:
    _, desks_count, time_limit = stdin.split()
    desks_count = int(desks_count)
    time_limit = int(time_limit)
    if desks_count < 1:
        return '-1'
    if desks_count * 2 > 10 ** 9:
        return '-1'
    if time_limit < 1:
        return '-1'
    if time_limit > 10 ** 9:
        return '-1'

    def read_book(book_num: int, time_limit: int, desks_count: int) -> int:
        if book_num < 1:
            return 0
        if book_num == 1:
            return 1
        if book_num > 10 ** 9:
            return 0
        if time_limit < 1:
            return 0
        if time_limit > 10 ** 9:
            return 0
        if desks_count < 1:
            return 0
        if desks_count == 1:
            return book_num
        if time_limit == 1:
            return 1

        # first read the books on the bookshelf
        # after reading the bookshelf, they can be on the desk
        # so the first book read is the topmost book on the bookshelf
        topmost_book = read_book(book_num - 1, time_limit, desks_count)
        if topmost_book == 0:
            return 0
        # if we can read all books from the bookshelf, no need to read the books on the desks
        if (time_limit - topmost_book) % 2 == 0:
            return topmost_book
        # if we cannot read all books from the bookshelf, read the books on the desks
        desks_read = read_book(book_num, time_limit - topmost_book, desk_count)
        if desks_read == 0:
            return 0
        # if we can read all books from the bookshelf, no need to read the books on the desks
        if (time_limit - topmost_book) % 2 == 0:
            return desks_read
        # if we cannot read all books from the bookshelf, read the books on the desks
        desk_read = read_book(book_num, time_limit - topmost_book, desk_count - desks_read)
        if desk_read == 0:
            return 0
        # if we can read all books from the bookshelf, no need to read the books on the desks
        if (time_limit - topmost_book) % 2 == 0:
            return desk_read + desks_read

    return str(read_book(desks_count, time_limit, desks_count))

